20.	Electronic Communication of Information

20.1	General - Transporter will maintain all information required pursuant to Section 250.16 of the FERC's regulations and NAESB Standard 4.3.6, plus additional information Transporter deems beneficial to its Shippers.  Matters between Shipper and Transporter will be conveyed through electronic communications by media such as fax or electronic mail.  

20.2	Internet Web Site.  Transporter will provide timely information on its Internet web site pertaining to Transportation.  Transporter will impose no fee associated with the use of its Internet web site.

20.3	Information to be Posted.  Via the Internet web site, Transporter will provide the following information:

(a)	total design capacity and capacity that is available at specific receipt and delivery points;

(b)	available capacity for primary firm transportation;

(c)	offers to release capacity;

(d)	the winning bids to purchase released capacity;

(e)	the potential available capacity and the terms and conditions required for bids under the right of first refusal procedures when an existing transportation service agreement is near expiration;

(f)	the capacity allocation log for marketing affiliates;

(g)	discount rate offers to marketing affiliates;

(h)	the names and addresses of Transporter's marketing affiliates;

(i)	complete list of the names of operating personnel and facilities shared by Transporter and its marketing affiliates and comprehensive organization charts;

(j)	information about the timing and status of maintenance activities;

(k)	notice of interruption or curtailment of scheduled quantities and other information about the status of any situations that may threaten the operation or integrity of the Transporter's system;

(l)	the rate of discounting to be used for determining discounted cash flows;

(m)	Transporter's tariff;

(n)	Transporter's index of customers; and

(o)	any other information or notices required to be posted by the FERC or necessary for Transporter and Shipper to arrange for transportation.

20.4	Disclaimer.  Transporter will not be liable for any damages caused by the incompleteness or inaccuracy of any information posted to Transporter's Internet web site except to the extent such inaccuracy or incompleteness is shown to be the result of gross negligence or willful misconduct of Transporter.  Transporter will not be liable for errors in any subsequent re-posting by a third-party vendor.

20.5	Record Retention.  Transactional data will be retained by Transporter for at least three (3) years for audit purposes.

2. QUALITY OF GAS:
2.1 Quality Standards: Unless the Transporter agrees to waive any specifications on a not unduly discriminatory basis, all Gas received by Transporter from Shipper shall conform to the following specifications: (a) the gas shall be free from objectionable odors, solid matter, dust, gums and gum-forming constituents, or any other substance which might interfere with the merchantability of the gas, or cause injury to or interference with proper operation of the line, meters, regulators, or other appliances through which it flows;
(b) shall have been dehydrated by Shipper for removal of water present therein in a vapor state to contain not more than seven (7) pounds of water vapor per one thousand (1,000) Mcf, as determined by use of the dew point moisture monitor apparatus mutually agreed upon; provided, however, Transporter may periodically waive this specification if in Transporter's sole, but reasonable opinion, the receipt of gas containing more than seven (7) pounds of water vapor per one thousand (1,000) Mcf will not impair the operation of the pipeline;
(c) shall contain not more than one quarter (1/4) grain of hydrogen sulfide per one hundred (100) cubic feet of gas as determined by a quantitative test mutually agreeable to the parties hereto after the presence of hydrogen sulfide has been indicated by qualitative test;
(d) shall contain not more than ten (10) grains of total sulphur per one hundred (100) cubic feet of gas;
(e) shall contain not more than a combined total of three percent (3%) by volume of carbon dioxide and/or nitrogen;
(f) shall contain no more than two tenths of one percent (.2%) by volume of oxygen;
(g) shall have a temperature of not more than one hundred twenty (120) degrees Fahrenheit; and
(h) shall a Btu content of not less than nine hundred fifty (950) per cubic foot.
Notwithstanding any other provision herein, Shipper may deliver at Transporter's Receipt Points gas that does not meet the quality specifications contained in 2.1(a) through (h) above, inclusive, so long as Transporter is satisfied that the blended gas stream at all Delivery Points meets the quality specifications, and so long as the safety and reliability of Transporter's system is not impaired, in Transporter's sole opinion, exercised in good faith; provided, however, if the blended gas stream at all Delivery Points does not meet the quality specifications or the safety and reliability of Transporter's system is impaired, in Transporter's sole opinion, exercised in good faith, Transporter will notify Shipper of such deficiency and if Shipper fails to remedy such deficiency promptly, the gas at the Receipt Point(s) most out of compliance with the quality specification shall be shut-in until the blended gas stream at the Delivery Point(s) meets the quality specification; and, if more than one Receipt Point is equally out of compliance, the shut-in shall be pro-rata as to those Receipt Points; provided further, that nothing herein shall restrict Transporter's right to refuse to accept further receipt of gas tendered for delivery to Transporter by Shipper which fails at any time to conform to the quality specifications in 2.1(a) through (h) above if the safety and reliability of Transporter's system is impaired, in Transporter's sole opinion exercised in good faith.
2.2 Quality Tests:
(a) The quality specifications of the gas delivered hereunder shall be determined by tests which Transporter shall cause to be made at each receipt and delivery point.
(b) The heating value of the gas delivered shall be calculated from a chromatographic analysis of a representative gas sample collected daily during the month, or any other method mutually agreed upon. Such chromatographs shall be owned, operated, and maintained by Transporter at Representative locations on Transporter's system, or as agreed upon.
(c) Tests shall be made to determine the total sulphur, hydrogen sulfide, carbon dioxide, nitrogen and oxygen content of the gas, by approved standard methods in general use in the gas industry, and to determine the hydrocarbon dewpoint and water vapor content of such gas by methods satisfactory to the parties. Tests shall be made frequently enough to assure that the gas is conforming continuously to the quality requirements. Transporter shall have the right to require Shipper to have remedied any deficiency of the gas in quality and, in the event such deficiency is not remedied, the right, in addition to all other remedies available to it by law, to refuse to accept such deficient gas from Shipper until such deficiency is remedied.

10.	REALLOCATION OF CAPACITY

10.1	Capacity Release Mechanism
Shippers receiving firm service pursuant to Transporter's FTS Rate Schedule will have the ability to relinquish all or part of their firm capacity on a temporary or permanent basis. Additionally, an Acquiring Shipper may re-release acquired capacity subject to the terms and conditions attached to the acquired capacity in all previous releases.  Transporter shall post all capacity release offers and bids, including capacity released on a prearranged basis, upon receipt, unless releasing Shipper requests otherwise.  Bids for released capacity may not exceed the maximum rate for the applicable rate schedules, except when the release is for a term of one year or less, and/or a release to an asset manager or a marketer participating in a state-approved retail access program; and provided further, that the release must take effect on or before one year from the date the pipeline is notified of the release. If a releasing shipper requests a posting time, Transporter will support such request, so long as it complies with the capacity release timeline.  The Capacity Release timeline is applicable to all parties involved in the Capacity Release process; however, it is only applicable if 1) all information provided by the parties t the transaction is valid and the acquiring shipper has been determined to be creditworthy before the capacity release bid is tendered and 2) there are no special terms or conditions of the release.  Temporary and permanent relinquishments shall be accomplished in the following manner.

Non-Biddable, prearranged relinquishments are relinquishments exempt from the bidding procedures as provided for in this Section 10 of the General Terms & Conditions and include: 1) relinquishments for 31 days or less (subject to the Rollover Limitations of Section 10.1D. of these General Terms & Conditions); 2) long-term (more than one year) relinquishments at the maximum rate; 3) a relinquishment to an asset manager as defined by Section 284.8 (h)(3) of the Commission's regulations; and 4) a relinquishment to a marketer participating in a state-approved retail access program as defined in Section 284.8(h)(4) of the Commission's regulations.  All other relinquishments shall be biddable.  For Non-Biddable relinquishments, the Acquiring Shipper must notify Transporter of a Non-Biddable relinquishment at least one hour prior to the nomination deadline for each of the five nomination cycles.  Posting of the Non-Biddable relinquishment shall be in accordance with the following timeline:

Timely Nomination Cycle:  Posting on Non-Biddable relinquishment due by 12:00 Noon;

Evening Nomination Cycle:  Posting of Non-Biddable relinquishment due by 5:00 P.M.;

Intraday 1 Nomination Cycle:  Posting of Non-Biddable relinquishment due by 9:00 A.M.;

Intraday 2 Nomination Cycle:  Posting of Non-Biddable relinquishment due by 1:30 P.M.

Intraday 3 Nomination Cycle:  Posting of Non-Biddable relinquishment due by 6:00 P.M.

Transporter shall tender a contract within one hour of the posting of the Non-Biddable relinquishment.  Acquiring Shipper may nominate at the next available nomination cycle for the effective date of the contract.

10.1A.1	Capacity Release Timeline For Biddable, Short Term Releases (one year or less)

* Offers must be tendered by 9:00 A.M. on a Business Day.
* Open season ends at 10:00 A.M. on  the same or subsequent Business Day.
* Evaluation period begins at 10:00 A.M. during which any contingencies are eliminated, determination of best Bid is made, and ties are broken.
* If no match is required, the evaluation period ends and the Award is posted by 11:00 A.M.
* Where match is required, the match is communicated by 11:00 A.M., the match response occurs by 11:30 A.M., and the Award is posted by 12:00 Noon.
* The contract is  issued within one hour of the Award posting (with a new contract number, when applicable.
* Nomination is possible beginning at the next available nomination cycle for the effective date of the contract.

10.1.A.2	Capacity Release Timeline For Biddable, Longer Term Releases (more than one year)

* Offers must be tendered such that they can be posted by 9:00 A.M. on a Business Day..
* Open season shall include no less than three 9:00 A.M. to 10:00 A.M. time periods on consecutive Business Days.
* Evaluation period begins at 10:00 A.M. during which any contingencies are eliminated, determination of best Bid is made, and ties are broken.
* If no match is required, the evaluation period ends and the Award is posted by 11:00 a.m.
* Where match is required, the match is communicated by 11:00 a.m., the match response occurs by 11:30 a.m., and the Award is posted by 12:00 Noon.
* The contract is issued within one hour of the Award posting (with a new contract number, when applicable).
* Nomination is possible beginning at the next available nomination cycle for the effective date of the contract.

10.1A.3	Shippers desiring to release firm capacity ("Releasing Shipper") shall submit the following information to Transporter, which shall be placed on the Transporter's Internet web site if valid.

i.	Quantity in dekatherms per day (MDTQ) to be released;

ii.	The contract number(s) of the Releasing Shipper's Service Agreement(s) and the path of released capacity (path between Primary Receipt Point(s) and Primary Delivery Point(s);

iii.	Term of release (number of months or permanent);

iv.	Identity of any replacement Shipper ("Replacement Shipper");

v.	Conditions of release;

(a)	whether bids for less than the full volume offered are acceptable;

(b)	whether bids for less than the full term are acceptable;

(c)	whether bids may be submitted that are contingent on the award of upstream or downstream capacity on another pipeline system and the deadline for removing such contingency;

(d)	any changes in the bidding deadlines so long as any changes comport with the capacity release timelines;

(e)	one of the following methods to evaluate bids 1) highest rate 2) net revenue and 3) present value;

(f)	a nondiscriminatory tie breaker in determining best bid if different 
	that in Section 10.1.C.;

(g)	whether there is a minimum price (including reservation surcharges) below which the Shipper will not release capacity;

(h)	whether bids should be expressed in dollars and cents or a percent of the maximum tariff rate (including surcharges)

(i) whether the Releasing Shipper will accept volumetric bids and
(ii)  volumetric commitments;

(j)	whether the proposed release is to an asset manager as a part of an asset management arrangement as defined in Section 284.4(h)(3) of the Commission's regulations or to a marketer participating in a state-mandated retail access program as defined in Section 284.8(h)(4) of the Commission's regulations and, if the proposed release is part of an asset management arrangement, the volumetric level of the asset manager's delivery or purchase obligation and the time period during which that obligation is in effect; 

(k)	other special conditions; if any.

vi.	Conditions of recall in accordance with NAESB Standards (including reput method and rights); Releasing Shippers may, to the extent permitted as a condition of the capacity release, recall released capacity (scheduled or unscheduled) at the Timely Nomination Cycle and the Evening Nomination Cycle, and recall unscheduled released capacity at the Intraday 1, Intraday 2 and Intraday 3 Nomination Cycles by providing notice to Transporter's Gas Management department via the Contacts information shown on Transporter's Internet web site.  Releasing Shipper must provide notice to the Transporter and the first Acquiring Shipper by the following times (Central Clock Time) for each cycle:

* 8:00 a.m. for the Timely Nomination Cycle;
* 3:00 p.m. for the Early Evening Recall notification
* 5:00 p.m. for the Evening Nomination Cycle;
* 7:00 a.m. for the Intraday 1 Nomination Cycle,
* 12:00 p.m. for the Intraday 2 Nomination Cycle; and,
* 4:00 p.m. for the Intraday 3 Nomination cycle.  

Notification to Acquiring Shipper will be provided by Transporter within one hour of receipt of recall notification.

The following shall be posted by Transporter with each offer: (i) the maximum reservation charge, (and reservation surcharges) applicable to the capacity being released, (ii) the maximum reservation charge (and reservation surcharges) converted to a 100% load factor volumetric rate if offer allows bids on a volumetric rate basis, (iii) the date and time the offer was posted on Transporter's Internet web site.  A Releasing Shipper will not be able to specify an extension of the original bid period or the prearranged deal match period without posting a new release.  Transporter shall remove any such postings at the end of the calendar month.

Once capacity is posted on the Transporter's Internet web site, it may be withdrawn from the bidding process any time due to an unanticipated change in the Releasing Shipper's need for capacity, through written notice to Transporter so long as no bids have been submitted which meet the minimum conditions of release. Offers should be binding until written or electronic notice of withdrawal is received by the capacity release service provider. The Releasing Shipper must notify Transporter of such change and such notice will be posted on Transporter's Internet web site.

10.1 B.	Shippers desiring to acquire the released capacity shall submit the following information to Transporter.  The information in (iii)-(vi) shall be placed on the Transporter's Internet web site if valid. Bids to acquire released capacity are binding until withdrawn at any time by written notice to Transporter prior to the conclusion of the bidding period.  Provided that having withdrawn a bid, the Shipper may not resubmit a bid for the same contract at a lower rate.  Transporter shall post the bidder's name if bidder agrees to such posting.

i.	Company Information.  Unless already provided, an acquiring Shipper must submit the information specified in Section 4.1(a)-(e) of the FTS Rate Schedule;

ii.	Creditworthiness.  Unless previously determined to be creditworthy by Transporter, Shipper shall provide the information necessary to establish creditworthiness to acquire the relinquished capacity;

iii.	Quantity (MDTQ) of released capacity to be acquired;

iv.	The contract number and path of capacity to be acquired (if different from path relinquished);

v.	The reservation charge bid, or the volumetric rate bid if allowed by Releasing Shipper;

vi.	Term Shipper is willing to acquire capacity,

vii.	If contingent bids are allowed by Releasing Shipper, the criteria of the contingency; and

viii.	Whether the bid is a Prearranged Bidder.

Prearranged Bidder's Right to Match.  A prearranged bid shall constitute the minimum bid for all other bidders.  If Transporter does not receive a better bid by the date on which bids are due, the prearranged bid shall be the winning bid.  If Transporter does receive a better bid by the date on which bids are due, the Prearranged Bidder shall have the right to match the terms of the better bid and shall be deemed to have made the best bid.

A potential Acquiring Shipper may post an offer to acquire capacity under the terms of this Section.

10.1 C.	Allocation of Released Capacity through bidding procedures.  Transporter shall make a preliminary determination of whether Transporter is physically able to accommodate the requests of individual Replacement Shippers based on the specific capacity released.  Between requests, which Transporter deems that it is physically able to accommodate, Transporter shall allocate released capacity in the following manner:

a)	Transporter will evaluate and rank all bids and will award bids, best bid first, until all offered capacity is awarded.

b)	In the event more than one Replacement Shipper offers the highest rate and meets the terms and conditions of the release, unless Releasing Shipper specifies another non-discriminatory method, Transporter shall allocate capacity to such Shippers on a pro rata basis.

10.1 D.	Rollover Limitations:  Prearranged relinquishments for 31 days or less are not subject to open season bidding except as provided below.  Prearranged relinquishments for 31 days of less under this provision may not be permitted to rollover, or otherwise be extended beyond the initial term of the release.  The Acquiring Shipper, its designee or affiliate may not acquire capacity under this provision from the releasing Shipper for twenty-eight (28) days following the expiration of the release under this provision without such acquisition being subject to posting and bidding requirements.  This Rollover Limitation is not applicable to a release to an asset manager or a marketer participating in a state-mandated retail access program.

In the event the temporary release is not at the maximum rate for the rate schedule under which the capacity is released and not subject to the 31 days or less provision, then the subject eligible capacity shall be subject to an open season bidding and the right to match.

10.1 E.1.	Releasing Shipper's and Acquiring Shipper's Obligations.

Acquiring Shipper:  To bid on capacity offered under temporary or permanent releases, the bidder must have preapproved credit under Section 17.  Any bid submitted and not withdrawn by the end of the bid period will legally bind the bidder to the terms of the bid if Transporter chooses such bid as the "best bid" under Section 10.1.C.  Once a bid on an offer of temporary or permanent release of capacity is accepted, the Acquiring Shipper shall execute a separate Service Agreement with Transporter under the terms and conditions of Transporter's FERC Gas Tariff.

Releasing Shipper:  The Releasing Shipper shall remain fully liable on its existing Service Agreement with Transporter for the payment of all reservation charges for the contract quantities.

10.1.E.2.	Billing and Payment.  The Releasing Shipper's bill for a month in which it released capacity on a temporary basis shall be credited by the amount Transporter bills Acquiring Shipper for the released capacity; provided however, that if Acquiring Shipper fails to pay Transporter the amount credited to Releasing Shipper's bill, Transporter reserves the right to reverse the credit on Releasing Shipper's bill in a later month.  The Releasing Shipper is not responsible for any commodity charges or penalties incurred by Acquiring Shipper; provided however, that Releasing Shipper is responsible for any reservation charges associated with capacity rights obtained by volumetric bids.  If any of the rates billed to and paid by the Acquiring Shipper under its Service Agreement exceeds the rate the Commission determines to be just and reasonable and Transporter is ordered to make refunds, the Acquiring Shipper shall be eligible to receive such refunds to the extent of any payments it made are in excess of the rates the Commission subsequently determined to be just and reasonable.  Any rate paid by an Acquiring Shipper in any capacity release transaction which is not subject to the maximum rate cap is deemed to be a final rate and is not subject to 	refund.

10.1 F.	Marketing Fee.  Transporter may receive compensation for actively marketing and successfully placing released capacity.  The level of such compensation shall be negotiated between Transporter and Releasing Shipper and proceeds received from the placement of capacity and will be deducted from the reservation fee credit due releasing Shipper.

10.1 G.	OFFERS TO PURCHASE RELEASED CAPACITY - Transporter agrees to post on its web site, offers to purchase released capacity. The party offering to purchase released capacity must be prequalified for creditworthiness under the provisions of this Tariff, and, complete and submit an "Offer to Purchase Released Capacity" form as indicated by the instructions therein.  The form is available for viewing and/or download in the "Downloads" category on Transporter's web site.

Each offer will be posted on Transporter's web site for the number of days in the month the posting commences.

All other provisions regarding an Acquiring Shipper and the release of firm capacity in this section apply.
